tables.table_schema:
CREATE TABLE departments (
    department_id INT PRIMARY KEY,
    department_name VARCHAR(50),
    manager_id INT,
    location VARCHAR(50)
);

CREATE TABLE Employee (
    employee_id INT PRIMARY KEY,
    name VARCHAR(50),
    age INT,
    department VARCHAR(50)
);

CREATE TABLE Job (
    job_id INT PRIMARY KEY,
    title VARCHAR(50),
    salary DECIMAL(10, 2),
    department VARCHAR(50)
);

CREATE TABLE Department (
    department_id INT PRIMARY KEY,
    name VARCHAR(50),
    location VARCHAR(50)
);

CREATE TABLE departments (
    id INT,
    name VARCHAR(255),
    location VARCHAR(255)
);

CREATE TABLE job_titles (
    id INT,
    title VARCHAR(255),
    description TEXT
);

CREATE TABLE employee_roles (
    employee_id INT,
    role_id INT,
    start_date DATE,
    end_date DATE
);
